INSERT INTO `fb_snist_questions` VALUES (1,'PEO –A: Graduates of the program will have requisite engineering knowledge with abilities for analysis of the problem and to design, development of solutions and to arrive at an optimal solution using modern tools which help them to be employable.',1,1),(2,'PEO–B: Ability to work in a team/ lead a team which needs effective communication skills and knowledge of project management, finance and entrepreneurial abilities.',1,1),(3,'PEO-C: Graduates should have abilities to conduct investigation of complex problems and attitude for lifelong learning skills which will enable them to pursue advanced studies, Research and Development.	',1,1),(4,'PEO-D: The graduates must be aware of the engineering professional ethics, the impact of engineering profession on the society and the need for environmental protection and sustainable development',1,1),(5,'An ability to apply knowledge of basic sciences, mathematics and engineering in the area of Computer Science.',1,1),(6,'An ability to design, implement and evaluate a software or software / hardware system to meet the desired needs within realistic constraints such as space and time.',1,1),(7,'An ability to use the techniques, skills, and modern engineering tools such as software testing tools, data warehousing and mining tools, necessary for practice as a CSE professional.',1,1),(8,'An ability to analyze and solve open-ended problems using mathematical foundations, algorithmic principles, and computer science theory in the modeling and design of computer-based systems in a way that demonstrates comprehension of the tradeoffs involved in design choices and to arrive at an optimal solution',1,1),(9,'To understand principles of engineering, entrepreneurship with emphasis on women, and financial management through relevant management courses to demonstrate knowledge in the conceptualization and realizing group projects, mini & main projects.',1,1),(10,'An ability to function effectively as individual and as a member or leader in diverse team in achieving multidisciplinary tasks.',1,1),(11,'Learn to communicate effectively on complex engineering activities through report writing, experimental work, assignments, seminars, group projects, mini & main projects.',1,1),(12,'To recognize the need for and have the preparation and ability to be a life-long learner through the courses such as seminars & projects.',1,1),(13,'An ability to identify, formulate and analyze engineering problems.',1,1),(14,'An ability to conduct investigation of complex problems in multidisciplinary areas.',1,1),(15,'An understanding of professional ethics and responsibilities.',1,1),(16,'An engineer should be aware of social, safety, cultural and information security issues and also responsibilities relevant to professional practice and skills.',1,1),(17,'An ability to understand the impact of environmental protection and sustainable development',1,1),(18,'Rate the syllabus of the programme with regard to proper distribution of the subjects in the areas of basic sciences including mathematics, humanities and management courses, interdisciplinary courses, departmental core courses, electives and projects',1,1),(19,'Rate your opinion on % of credits given in your curriculum for Basic Sciences including Mathematics - Presently about 15%. If you think this proportion is OK pl. Rank as 5 or else [4/3/2/1]',1,1),(20,'Rate your opinion on % of credits given in your curriculum for Humanities and Management courses - Presently about 10%. If you think this proportion is OK pl. Rank as 5 or else [4/3/2/1]',1,1),(21,'Rate your opinion on % of credits given in your curriculum for Professional Core - Presently about 50%. If you think this proportion is OK pl. Rank as 5 or else [4/3/2/1].',1,1),(22,'Rate your opinion on % of credits given in your curriculum for Electives - Presently about 15%. If you think this proportion is OK pl. Rank as 5 or else [4/3/2/1]',1,1),(23,'Rate your opinion on % of credits given in your curriculum for Other inter disciplinary Courses - Presently about 10%. If you think this proportion is OK pl. Rank as 5 or else [4/3/2/1]',1,1),(24,'Rate the extent of usefulness with regard to Basic Sciences including Mathematics .',1,1),(25,'Rate the extent of usefulness with regard to Humanities and Management courses.',1,1),(26,'Rate the extent of usefulness with regard to Professional Core ',1,1),(27,'Rate the extent of usefulness with regard to Electives.',1,1),(28,'Rate the extent of usefulness with regard to inter disciplinary Courses .',1,1),(29,'Rate the syllabus content of Basic Sciences including Mathematics was easy or difficult.',1,1),(30,'Rate the syllabus content of Humanities and Management courses was easy or difficult.',1,1),(31,'Rate the syllabus content of Professional Core was easy or difficult.',1,1),(32,'Rate the syllabus content of Electives was easy or difficult.',1,1),(33,'Rate the syllabus content of inter disciplinary Courses was easy or difficult.',1,1),(34,'Rate the overall programme',1,1),(35,'Rate the extent of Opportunities given to you to perform as team member / team leader.[group, mini , major project, co-curricular and extra-curricular activities such as ADASTRA, SREEVISION, ARTS CLUB, ROBOVEDA, SPARDHA etc..',1,1),(36,'Rate the extent of conduct of Seminars, workshops and student development programmes has enabled you to improve oral, written communication and technical skills.',1,1),(37,'Rate the extent of attainment of technical abilities through group, mini and main projects to face the challenges of taking up new projects in your professional career .',1,1),(38,'Rate the extent of utility of IT courses and software tools to design and develop the application were adequate in your professional advancement .',1,1),(39,'Pl. rate the facilities provided in the class rooms [ LCDs’ , OHPs’, Lighting etc..]',1,1),(40,'Rate the functioning of the Laboratory equipment [Facility for conduct of experiment ]',1,1