arnt enough to be one of good devs in our college. And most of these things i learnt are on my own, what i lacked was a right sense of direction. I used to code whatever i feel like too, hackathons, some clubs are pretty much boring down the road for me. I just like to code, and i want my code to be actually useful(not like a codejam where you get write chocolate decoders and wonder where they will be useful). Actual SE is what i want, and unfortunately time flied faster than i expected',11,'2015-05-15 06:48:17',0),(159,49,'^POST2</br>And talking about our college, if we can grade our coding standards on a scale of 0 to 10, even best of us may not cross 5.<br> Reason 1: We are Spoon Fed<br>Reason 2: No one gives a shit about Computer Science<br>Reason 3: We lack Resources<br>I would amount the reason 3 as main cause for those who are interested. So, that\'s why we started building a common platform where we can develop a actual real time application. </br>Now since i already gave a shitty introduction, why dont we start hacking</br>♥  Open SNIST</br>#pixelpushing</br><a href=\"image.php?id=14\"	 id=\"imagePop\"><img class=\"img-responsive\" id=\"postImage\" src=\"image.php?id=14\" alt=\"click to enlarge\"></img></a>',11,'2015-05-15 07:04:26',0),(160,19,'hello\n\nthis preserves line breaks',11,'2015-05-15 07:25:49',1),(161,6,'hello',11,'2015-05-15 07:47:35',0),(162,6,'demo moshi moshi',2,'2015-05-15 07:48:05',0),(163,6,'4chan',2,'2015-05-15 07:48:10',0);
